import {BrowserRouter,Routes,Route} from 'react-router-dom'
import Home from './components/Home';
import Apartament from './components/Apartament';
import Contact from './components/Contact';
import Rio from './components/Rio'
import Book from './components/Book'
import RoomDescription from './RoomDescription';
import { useState } from 'react';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
         <Routes>
           <Route path='/' element={<Home/>}/>
           <Route path='/Our Apartament' element={<Apartament/>}/>
           <Route path='/Rio' element={<Rio/>}/>
           <Route path='/Contact'element={<Contact/>}/>
           <Route path='/Book' element={<Book/>}/>
           <Route path='/roomdescription/:junior' element={<RoomDescription description='junior'/>}/>
           <Route path='/roomdescription/:standart' element={<RoomDescription description='standart'/>}/>
           <Route path='/roomdescription/:superior' element={<RoomDescription description='superior'/>}/>
           <Route path='/roomdescription/:standart' element={<RoomDescription description='standart'/>}/>
         </Routes>
      </BrowserRouter>
     </div>
  )}
export default App
